import React, { useEffect } from "react";

const Rating = ({ bullets = 5 }) => {
  const ratingInput = <span className="border border-cyberPink p-2 rounded" />;
  let bulletsArray = [];
  const printMovieRating = () => {
    for (let i = 0; i < bullets; i++) {
      bulletsArray.push({ id: i });
    }
    console.log("test kimo", bulletsArray);
  };
  useEffect(() => {
    printMovieRating();
  }, []);

  const bulletItem = bulletsArray.map(() => {
    return <span className="border border-cyberPink p-2 rounded" />;
  });
  return <div>{bulletItem}</div>;
};

export default Rating;
